resources.string:
Εκδόσεις υπογραφής για εκδόσεις Android:
V1 - η πρώτη επιλογή υπογραφής, η μόνη έως το Android 7.0;
V2 - προστέθηκε στο Android 7.0;

Η έκδοση υπογραφής θα πρέπει να χρησιμοποιείται με βάση την ελάχιστη/στόχο απαιτούμενη έκδοση Android για την εφαρμογή. Αν η έκδοση στόχος είναι 30+ (Android 11+), η υπογραφή V2 απαιτείται.

Εάν δεν επιλέξετε το πλαίσιο ελέγχου "Αποθήκευση", τότε τα επιλεγμένα σχήματα θα χρησιμοποιηθούν μόνο αυτή τη φορά.

Εκδόσεις υπογραφής για εκδόσεις Android:
V1 – η πρώτη επιλογή υπογραφής, η μόνη έως το Android 7.0;
V2 – προστέθηκε στο Android 7.0;
V3 – προστέθηκε στο Android 9.0;
V4 – προστέθηκε στο Android 11;

Η έκδοση υπογραφής θα πρέπει να χρησιμοποιείται με βάση την ελάχιστη/στόχο απαιτούμενη έκδοση Android για την εφαρμογή. Εάν η έκδοση στόχος είναι 30+ (Android 11+), απαιτείται τουλάχιστον υπογραφή V2.
Η V2 ή V3 πρέπει να χρησιμοποιείται μαζί με την υπογραφή V4. Η έκδοση V4 δεν χρησιμοποιείται σχεδόν ποτέ.

Εάν δεν επιλέξετε το πλαίσιο ελέγχου "Αποθήκευση", τότε τα επιλεγμένα σχήματα θα χρησιμοποιηθούν μόνο αυτή τη φορά.
